      if (!this._calculateTotal()) {
        this.colors = this.noDataColors;
        data = {
          'label': 'Pie 1',
          'values': [{
              'label': 'No Data',
              'value': 100
            }]
        };
      }
      data.values.forEach(function (d) {
        d.uid = 'slice-id-' + Openhose._.uniqueId();
      });
