        var lineId = lineName.replace(/[^\w]/g, '') + '-' + l;
        var selection = Openhose.d3.select(this.graph.element.getElementsByTagName('svg')[0])  //.selectAll("circle.line-id-"+lineId).data(this.graph.stackedData[l]);
